text:
Eclesiastes 3

1. Tudo tem a sua ocasião própria, e há tempo para todo propósito debaixo do céu.
2. Há tempo de nascer, e tempo de morrer; tempo de plantar, e tempo de arrancar o que se plantou;
3. tempo de matar, e tempo de curar; tempo de derribar, e tempo de edificar;
4. tempo de chorar, e tempo de rir; tempo de prantear, e tempo de dançar;
5. tempo de espalhar pedras, e tempo de ajuntar pedras; tempo de abraçar, e tempo de abster-se de abraçar;
6. tempo de buscar, e tempo de perder; tempo de guardar, e tempo de deitar fora;
7. tempo de rasgar, e tempo de coser; tempo de estar calado, e tempo de falar;
8. tempo de amar, e tempo de odiar; tempo de guerra, e tempo de paz.
😊

A binary frame for Genesis 1-2:

(1). The General, 'masculine' cosmos, and the Special, 'feminine' Earth (Gen 1:1);
       (2). The general Earth, and its special water (it's abiding maximal abundance of open liquid water (v. 2);
              (3). The Earth's general water, and its cycling (the water cycle, vs. 3-10);
                     (4). The general water cycle, and its special...biological life (vs. 11-12);
                            (5). General biological life, and its special...animal life (vs. 20-25);
                                   (6). General animal life, and it special...human life (plant/animal/mineral/physics=animal; vs. 26-29);
(7). The general human, and the special...woman (Genesis 2:7-25).

